import React, {Component} from 'react';
import Event from './Event'
import "bootstrap/dist/css/bootstrap.min.css"
import Details from './Details';

export default class EventList extends Component {
    render() {
        return (
            <div>
                <Event/>
                <EventList/>
                <Details/>
                
            </div>
        );
    }
}
